import React, { Component } from "react";
import { GridList, Grid, Container, Button } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <Container>
        <h2>Cart</h2>

        <GridList
          cellHeight={120}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["white", "yellow", "blue"].map(color => (
            <Grid
              container
              direction="row"
              style={{
                alignContent: "center",
                alignItems: "center",
                justifyContent: "center"
              }}
            >
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt="Cart"
              />
              <Grid>
                <h5 style={{ textAlign: "left" }}>Cà phê Sôcôla</h5>
                <h5 style={{ textAlign: "left" }}>Information</h5>
                <Button style={{ color: "red", fontSize: "10" }}>Delete</Button>
              </Grid>
              <h4>36.000đ</h4>
            </Grid>
          ))}
        </GridList>
      </Container>
    );
  }
}

export default Cart;

